script: |
  super -f text -I q11496.spq | sort > q11496.out

inputs:
  - name: q11496.spq
    data: |
      SELECT - col2 * - col2 + - col1 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE col2 + + col2 + - col2 + + - col0 * - col1 / col2 * + col1 * - - col1 / col2 BETWEEN + 75 / - - col1 AND + ( - ( + col2 ) );
  - name: tab0

outputs:
  - name: q11496.out
    data: |
